import HomeTest from './home';

function App() {

  async function asd() {
    try {
      let response = await fetch('https://api.coingecko.com/api/v3/simple/price?ids=bitcoin&vs_currencies=usd');
      const json = await response.json();
      // const { result } = json;
      console.log("json", json)
      // console.log("data", data)
    } catch(err) {
      console.log(err); 
    }
  }

  asd();

  return (
    <HomeTest/>

  );
}

export default App;
